package androidx.credentials.registry.digitalcredentials.preview

import android.graphics.Bitmap
import androidx.annotation.RestrictTo
import androidx.credentials.registry.digitalcredentials.mdoc.MdocEntry
import androidx.credentials.registry.digitalcredentials.mdoc.MdocField
import androidx.credentials.registry.provider.digitalcredentials.DigitalCredentialEntry
import androidx.credentials.registry.provider.digitalcredentials.DigitalCredentialRegistry
import androidx.credentials.registry.provider.digitalcredentials.VerificationEntryDisplayData
import androidx.credentials.registry.provider.digitalcredentials.VerificationFieldDisplayData
import java.io.ByteArrayOutputStream
import java.nio.ByteBuffer
import java.nio.ByteOrder
import org.json.JSONArray
import org.json.JSONObject

/**
 * A registration request containing data that can serve the preview protocol based request.
 *
 * @param credentialEntries the list of entries to register
 * @param id the unique id that identifies this registry, such that it won't be overwritten by other
 *   different registries of the same type; default to a preview specific ID which should be used
 *   unless you need to maintain multiple preview protocol based registries at the same time
 */
@RestrictTo(RestrictTo.Scope.LIBRARY_GROUP)
public class PreviewRegistry(
    credentialEntries: List<DigitalCredentialEntry>,
    id: String = DEFAULT_ID,
) :
    DigitalCredentialRegistry(
        id = id,
        credentials = credentialEntries.toCredentialBytes(),
        matcher = getDefaultPreviewMatcher()
    ) {
    internal companion object {
        const val DEFAULT_ID = "androidx.credentials.registry.digitalcredentials.preview.ID_PREVIEW"

        private fun getIconBytes(icon: Bitmap): ByteArrayOutputStream {
            val scaledIcon = Bitmap.createScaledBitmap(icon, 32, 32, true)
            val stream = ByteArrayOutputStream()
            scaledIcon.compress(Bitmap.CompressFormat.PNG, 100, stream)
            return stream
        }

        private fun MdocField.toJson(): JSONObject {
            val field = JSONObject()
            field.put("name", fieldName)
            field.putOpt("value", fieldValue)
            fieldDisplayData.forEach { fieldDisplayData ->
                when (fieldDisplayData) {
                    is VerificationFieldDisplayData -> {
                        field.put("display_name", fieldDisplayData.displayName.toString())
                        field.putOpt("display_value", fieldDisplayData.displayValue.toString())
                    }
                    else ->
                        throw UnsupportedOperationException(
                            "FieldDisplayData type ${fieldDisplayData::class.java} isn't supported by the preview protocol."
                        )
                }
            }
            return field
        }

        private fun MdocEntry.toJson(
            iconIndex: Int?,
            verificationEntryDisplayData: VerificationEntryDisplayData
        ): JSONObject {
            val credential = JSONObject()
            credential.put("format", "mso_mdoc")
            val displayInfo = JSONObject()
            displayInfo.put("title", verificationEntryDisplayData.title.toString())
            displayInfo.putOpt("subtitle", verificationEntryDisplayData.subtitle?.toString())
            displayInfo.putOpt("disclaimer", verificationEntryDisplayData.explainer?.toString())
            displayInfo.putOpt("warning", verificationEntryDisplayData.warning?.toString())
            displayInfo.putOpt("icon_id", iconIndex)
            credential.put("display_info", displayInfo)
            val fieldsJson = JSONArray()
            val docTypeField =
                MdocField(
                    fieldName = "doctype",
                    fieldValue = docType,
                    fieldDisplayData = setOf(VerificationFieldDisplayData(displayName = "Doctype"))
                )
            fieldsJson.put(docTypeField.toJson())
            fields.forEach { fieldsJson.put(it.toJson()) }

            credential.put("fields", fieldsJson)

            val result = JSONObject()
            result.put("id", id)
            result.put("credential", credential)
            return result
        }

        fun List<DigitalCredentialEntry>.toCredentialBytes(): ByteArray {
            val json = JSONObject()
            val credListJson = JSONArray()
            val icons = ByteArrayOutputStream()
            val iconSizeList = mutableListOf<Int>()
            this.forEach { entry ->
                when (entry) {
                    is MdocEntry -> {
                        entry.entryDisplayData.forEach { entryDisplayData ->
                            when (entryDisplayData) {
                                is VerificationEntryDisplayData -> {
                                    val iconBytes = getIconBytes(entryDisplayData.icon)
                                    credListJson.put(
                                        entry.toJson(iconSizeList.size, entryDisplayData)
                                    )
                                    iconSizeList.add(iconBytes.size())
                                    iconBytes.writeTo(icons)
                                }
                                else ->
                                    throw UnsupportedOperationException(
                                        "EntryDisplayData type ${entryDisplayData::class.java} isn't supported by the preview protocol."
                                    )
                            }
                        }
                    }
                    else ->
                        throw UnsupportedOperationException(
                            "Entry type ${entry::class.java} isn't supported by the preview protocol."
                        )
                }
            }
            json.put("credentials", credListJson)
            val credsBytes = json.toString(0).toByteArray()
            val result = ByteArrayOutputStream()
            // header_size
            result.write(intBytes((3 + iconSizeList.size) * Int.SIZE_BYTES))
            // creds_size
            result.write(intBytes(credsBytes.size))
            // icon_size_array_size
            result.write(intBytes(iconSizeList.size))
            // icon offsets
            iconSizeList.forEach { result.write(intBytes(it)) }
            result.write(credsBytes)
            icons.writeTo(result)
            return result.toByteArray()
        }

        fun getDefaultPreviewMatcher(): ByteArray =
            ""
                .chunked(2)
                .map { it.toInt(16).toByte() }
                .toByteArray()

        fun intBytes(num: Int): ByteArray =
            ByteBuffer.allocate(Int.SIZE_BYTES).order(ByteOrder.LITTLE_ENDIAN).putInt(num).array()
    }
}
